Verenigde Staten
Actie / Misdaad
91 minuten

geregisseerd door Walter Hill
met Sylvester Stallone, Sung Kang en Jason Momoa

Een huurmoordenaar vormt een team met een jonge NYPD rechercheur in een gewaagd onderzoek dat hen van de groezelige achterbuurten van New Orleans naar de machtige top van Washington leidt. Het onwaarschijnlijke duo, bij elkaar gebracht door twee wrede moorden, neemt het op tegen iedereen die hen in de weg staan, en wil koste wat het kost wraak nemen.



